window.bookSummaryJSON = "\"If we accept Wittgenstein's word for it,\" Paul Strathern writes, \"he is the last philosopher. In his view, philosophy in the traditional sense was finished.\" <p> In <i>Wittgenstein in 90 Minutes</i>, Paul Strathern offers a concise, expert account of Wittgenstein's life and ideas and explains their influence on man's struggle to understand his existence in the world.</p>"; 
